  :object: "Stanzas 5 and 6 of the first manuscript version of \"The Burden of Nineveh,\" showing significant variants from published versions.\n\n\
    Transcription:\n\
    \t\t5.\n\
    The sun waxed fully present. Blue\n\
    And huge, the beast its shadow threw.\n\
    No shade that plague of darkness knew,\n\
    No light, no shade, while older grew\n   By ages the old earth and sea.\n\
    How much Heaven\xE2\x80\x99s thunder, -- how much else\n\
    Man\xE2\x80\x99s puny roar, -- what cry of shells\n\
    Cleft amid leaguered citadels,\n\
    How many lordships loud with bells,\n   Heards\xE2\x80\x99t thou in secret Nineveh?\n\n\
    \t\t6\n\
    On the grey stones the shape lay scor\xE2\x80\x99d,\n\
    That day when, nigh the gates, the Lord\n\
    Sheltered His Jonah with a gourd,\n\
    This sun, (I said,) that here present, pour\xE2\x80\x99d\n   Even thus this shadow that I see.\n\
    This shadow has been shed the same\n\
    From sun and moon, -- from lamps which came\n\
    For worship, -- from those days in flame\n\
    That scorched into a shrivelled name\n   Sardanapalus\xE2\x80\x99 Nineveh \xE2\x80\x93\n\n"
