  :predicate: http://www.nines.org/schema#annotation
  :object: "Stanza 7 of the earliest known version of \"The Burden of Nineveh,\" showing interesting variants from the published versions. This manuscript has not been traced.\n\n\
    Transcription:\n\
    \t\t7.\n\
    Within his shadow, haply, knelt once\n\
    Sennacherib has knelt, whose sons\n\
    Did smite him twixt the altar stones:\n\
    Thou peradventure heards\xE2\x80\x99t his groans,\n   For his god his god thou may\xE2\x80\x99st be.\n\
    Oh! And what men in war asked thine aid\n\
    In years of old, till neath thy shade\n\
    Within those trenches he had made,\n\
    Last year the Christian knelt & pray\xE2\x80\x99d\n   In thy reconquered Nineveh?\n\n"
